import Body from "./component/Body";
import Hero from "./component/Hero";
import Logo from "./component/Logo";
import CarouselSlide from './component/CarouselSlide'
import Map from './component/Map'



function App() {
  return (
    <div>
      <Logo />
      <Hero />
      <CarouselSlide />
      <Map />
    </div>
  );
}

export default App;
